    /**
     * @param string $route
     * @return string[]&callable
     * @throws UnresolvableModelException
     */
    public function resolveModelRoute(string $route): array {
        if ($this->hasModelRoute($route) === true) {
            return $this->models[$route];
        }

        throw new UnresolvableModelException(sprintf(
            "Error: Model '%s' was not found.",
            $route
        ));
    }

    /**
     * @param string $route
     * @return bool
     */
    public function hasModelRoute(string $route): bool {
        return array_key_exists($route, $this->models);
    }

    /**
     * @param string $route
     * @param string[]&callable $callable
     */
    public function addModelRoute(string $route, array $callable): void {
        $this->models[$route] = $callable;
    }
